import React from 'react';
import '../styles.css';

function About() {
  return (
    <section id="about" className="about">
      <div className="container">
        <h2>About Us</h2>
        <p>Learn more about our team and our commitment to quality service.</p>
      </div>
    </section>
  );
}

export default About;
